import React from 'react';
import './gradientborderbutton.css';

const gradientborderbutton = ({onClick, name, logo, classname}) => {
  return (
    <>
        <button
          className="cityButton"
          onClick={onClick}
        >
          <div className="buttonContent">
            {logo ? <span className="locationLogo">
              <img src={logo} alt="" />
            </span>: "" 
            }
            
            <span className="place">{name}</span>
          </div>
        </button>
    </>
  )
}

export default gradientborderbutton
